import React from 'react';
import './Cards.css';
import award from '../Images/award.png';

const Cards = ({ ID }) => {
  switch (ID) {
    case 1:
      return (
        <div className='card'>
          <div className='cardEllipse'>
            <img src={award} alt='img.png' />
          </div>
          <div className='cardContent'>
            {/* Your card content goes here */}
            <h2>Your Card Title</h2>
            <p>Your card content goes here.</p>
          </div>
        </div>
      );
    default:
      return null; // You might want to handle other cases as needed
  }
};

export default Cards;
